"vs/workbench/parts/codeEditor/electron-browser/languageConfiguration/languageConfigurationExtensionPoint":["Ошибок при анализе {0}: {1}","Открывающий символ скобки или строковая последовательность.","Закрывающий символ скобки или строковая последовательность.","Определяет символы комментариев","Определяет способ маркировки комментариев.","Последовательность символов, открывающая блок комментариев.","Последовательность символов, закрывающая блок комментариев.","Последовательность символов, с которой начинается строка комментария.","Определяет символы скобок, увеличивающие или уменьшающие отступ.","Определяет пары скобок. Когда введена открывающая скобка, автоматически добавляется закрывающая.","Определяет список областей, где автоматические пары отключены.","Определяет пары скобок, в которые заключается выбранная строка.","Определение слова для языка.","Шаблон регулярного выражения, используемый для сопоставления слов.","Флаги регулярного выражения, используемого для сопоставления слов.",'Должно соответствовать шаблону "/^([gimuy]+)$/".',"Параметры отступов языка.","Если строка соответствует шаблону, то ко всем следующим строкам необходимо применить одинарный отступ (если не применяется другое правило).","Шаблон регулярного выражения для increaseIndentPattern.","Флаги регулярного выражения для  increaseIndentPattern.",'Должно соответствовать шаблону "/^([gimuy]+)$/".',"Если строка соответствует шаблону, то для всех следующих строк нужно уменьшить количество отступов на один (если не применяется другое правило). ","Шаблон регулярного выражения для decreaseIndentPattern.","Флаги регулярного выражения для decreaseIndentPattern.",'Должно соответствовать шаблону "/^([gimuy]+)$/".',"Если строка соответствует шаблону, то необходимо применить одинарный отступ **только к следующей строке**.","Шаблон регулярного выражения для indentNextLinePattern.","Флаги регулярного выражения для indentNextLinePattern.",'Должно соответствовать шаблону "/^([gimuy]+)$/".',"Если строка соответствует шаблону, то отступ для этой строки не следует изменять и проверять на соответствие другим правилам.","Шаблон регулярного выражения для unIndentedLinePattern.","Флаги регулярного выражения для unIndentedLinePattern.",'Должно соответствовать шаблону "/^([gimuy]+)$/".',"Параметры сворачивания языка.","Язык придерживается правила отступов, если блоки в этом языке определяются отступами. Если этот параметр установлен, пустые строки будут принадлежать последующему блоку.","Метки свертывания для конкретного языка, например, '#region' и '#endregion'. Регулярные выражения начала и окончания будут применены к содержимому всех строк. Их следует тщательно продумать.","Шаблон регулярного выражения для метки начала. Регулярное выражение должно начинаться с '^'.","Шаблон регулярного выражения для метки окончания. Регулярное выражение должно начинаться с '^'. "],
