"vs/workbench/parts/debug/browser/debugActions":["Открыть {0}",'Настройте или исправьте "launch.json"',"Чтобы перейти к расширенной конфигурации отладки, сначала откройте папку.","Начать отладку","Начать без отладки","Выбрать и начать отладку","Перезапустить","Повторно подключить","Шаг с обходом","Шаг с заходом","Шаг с выходом","Остановить","Отключить","Продолжить","Приостановить","Перезапустить кадр","Удалить точку останова","Удалить все точки останова","Включить точку останова","Выключить точку останова","Включить все точки останова","Отключить все точки останова","Активировать точки останова","Отключить точки останова","Повторно применить все точки останова","Добавить точку останова в функции","Добавить условную точку останова…","Изменить точку останова…","Задать значение","Добавить выражение","Изменить выражение","Добавить контрольное значение","Удалить выражение","Удалить все выражения","Очистить консоль","Консоль отладки","Новые выходные данные в консоли отладки","Фокус консоли отладки","Обработка фокуса","На шаг назад","Обратно"],
