"vs/workbench/parts/tasks/electron-browser/jsonSchema_v1":["Номер версии конфигурации","Средство запуска завершило работу. Используйте официальное свойство средства запуска","Определяет, следует ли запустить задачу в качестве процесса с отображением выходных данных задачи в окне вывода или в терминале.","Настройка команд Windows","Настройка команд Mac","Настройка команд Linux","Указывает, является ли команда командой оболочки или внешней программой. Если опущено, значение по умолчанию — false."],
"vs/workbench/parts/tasks/electron-browser/jsonSchema_v2":["Указывает, является ли команда командой оболочки или внешней программой. Если опущено, значение по умолчанию — false.","Свойство isShellCommand является устаревшим. Используйте свойство типа задачи и свойство оболочки в параметрах. Также см. заметки о выпуске для версии 1.14.","Другая задача, от которой зависит эта задача.","Другие задачи, от которых зависит эта задача.","Настраивает панель, которая используется для представления выходных данных задачи и считывает входные данные задачи.","Определяет, стоит ли отправлять выходные данные выполняемой команды на панель. Значение по умолчанию — true.","Определяет, принимает ли панель фокус. По умолчанию — false. Если установлено значение true, панель также отображается.","Всегда открывать окно терминала при выполнении этой задачи.","Отображать окно терминала только в том случае, если с этой задачей не связан сопоставитель проблем и при выполнении задачи возникли ошибки.","Никогда не открывать окно терминала при выполнении этой задачи.",'Определяет, отображается ли панель, на которой запущена задача. Значение по умолчанию — "always".',"Определяет, является ли панель общей для нескольких задач, ограничена ли она только одной задачей или создается отдельно для каждого запуска задачи.","Свойство terminal является устаревшим. Используйте свойство presentation","Группа выполнения задачи","Определяет, является ли эта задача задачей по умолчанию в группе.","Отмечает задачу как задачу сборки по умолчанию.","Отмечает задачу как задачу тестирования по умолчанию.",'Отмечает задачу как задачу сборки, доступ к которой осуществляется с помощью команды "Запустить задачу сборки".','Отмечает задачу как задачу тестирования, доступ к которой осуществляется с помощью команды "Запустить задачу тестирования".',"Отменяет связь задачи со всеми группами",'Определяет, к какой группе выполнения принадлежит эта задача. Поддерживаемые значения: "build" для добавления задачи к группе сборки и "test" для добавления задачи к группе тестирования.',"Определяет, выполняется ли задача в виде процесса или в виде команды оболочки.","Метка пользовательского интерфейса задачи","Номер версии конфигурации.","Пользовательский идентификатор задачи в файле launch.json или в предложении dependsOn.","Метка задачи","Имя задачи","Свойство name задачи является устаревшим. Используйте свойство label.","Поддерживается ли выполняющаяся задача в работающем состоянии и исполняется ли она в фоновом режиме.","Отображается ли для пользователя приглашение, если VS Code закрывается с выполняющейся задачей.","Используемые сопоставители проблем. Это может быть строка, определение сопоставителя проблем или массив строк и сопоставителей проблем.","Тип задачи, который будет изменен","Свойство customize является устаревшим. Сведения о том, как перейти на новый подход к изменению задач, см. в заметках о выпуске для версии 1.14.","Свойство name задачи является устаревшим. Используйте свойство label.","Свойство showOutput является устаревшим. Используйте свойство reveal в свойстве presentation вместо этого свойства. Также см. заметки о выпуске для версии 1.14.","Свойство echoCommand является устаревшим. Используйте свойство echo в свойстве presentation вместо этого свойства. Также см. заметки о выпуске для версии 1.14.","Свойство suppressTaskName является устаревшим. Вместо использования этого свойства включите команду с аргументами в задачу. Также см. заметки о выпуске для версии 1.14.","Свойство isBuildCommand является устаревшим. Используйте свойство group вместо этого свойства. Также см. заметки о выпуске для версии 1.14. ","Свойство isTestCommand является устаревшим. Используйте свойство group вместо этого свойства. Также см. заметки о выпуске для версии 1.14. ","Свойство suppressTaskName является устаревшим. Вместо использования этого свойства включите команду с аргументами в задачу. Также см. заметки о выпуске для версии 1.14.","Свойство taskSelector является устаревшим. Вместо использования этого свойства включите команду с аргументами в задачу. Также см. заметки о выпуске для версии 1.14.","Настройка команд Windows","Настройка команд Mac","Настройка команд Linux"],
