"vs/workbench/parts/terminal/electron-browser/terminal.contribution":["Показать все открытые терминалы","Терминал","Интегрированный терминал","Путь оболочки, который используется терминалом в Linux.","Аргументы командной строки, которые следует использовать в терминале Linux.","Путь оболочки, который используется терминалом в OS X.","Аргументы командной строки, которые следует использовать в терминале OS X.","Путь к оболочке, который используется терминалом в Windows. Для оболочек, входящих в состав ОС Windows (cmd, PowerShell или Bash в Ubuntu).","Аргументы командной строки, используемые в терминале Windows.","Если задано, блокирует отображение контекстного меню при щелчке правой кнопкой мыши в терминале. Вместо этого будет выполняться копирование выбранного элемента и вставка в область, в которой нет выбранных элементов.","When set, text selected in the terminal will be copied to the clipboard.","Определяет семейство шрифтов терминала, значение по умолчанию — editor.fontFamily.","Определяет размер шрифта (в пикселях) для терминала.","Определяет высоту строки терминала; это число умножается на размер шрифта терминала, что дает фактическую высоту строки в пикселях.","Следует ли разрешить полужирный текст в терминале. Эта функция должна поддерживаться оболочкой терминала.","Управляет миганием курсора терминала.","Определяет стиль курсора терминала.","Определяет предельное число строк в буфере терминала.",'Управляет заданием переменных при запуске терминала, значение по умолчанию: "True" для OS X и "False" для других платформ.',"Путь явного запуска, по которому будет запущен терминал. Используется в качестве текущего рабочего каталога (cwd) для процесса оболочки. Это может быть особенно удобно в параметрах рабочей области, если корневой каталог не является подходящим каталогом cwd.","Указывает, следует ли при выходе выводить подтверждение об имеющихся активных сеансах терминала.","Whether the terminal bell is enabled on not.","Набор идентификаторов команд, настраиваемые сочетания клавиш которых не будут передаваться в оболочку, а вместо этого будут всегда обрабатываться Code. Это позволяет использовать настраиваемые сочетания клавиш, которые при обычных условиях были бы использованы оболочкой и работали бы так же, как если бы терминал не имел фокуса, например клавиши CTRL+P запускали бы Quick Open.","Объект с переменными среды, которые будут добавлены к процессу VS Code для использования в терминале OS X","Объект с переменными среды, которые будут добавлены к процессу VS Code для использования в терминале Linux ","Объект с переменными среды, которые будут добавлены к процессу VS Code для использования в терминале Windows","Show alert `The terminal process terminated with exit code` when exit code is non-zero.","Терминал","Терминал","Просмотреть"],
